import React, { Component } from "react";

class HarbitAddForm extends Component {
  onSubmit = (event) => {
    event.preventDefault();
  };
  render() {
    return (
      <form className="add-form" onSubmit={this.onSubmit}>
        <input
          type="text"
          className="add-input"
          placeholder="Habit"
          onChange={this.handleinput}
        />
        <button className="add-bottun">Add</button>
      </form>
    );
  }
}

export default HarbitAddForm;
